    def button_start_mobs_f(self):
        _translate = QtCore.QCoreApplication.translate
        if self.Box_Mobs.currentText() != 'Выберите моба..':
            if self.Button_Start_Mobs.text() == 'Старт':
                self.Button_Start_Mobs.setText(_translate("MainWindow", "Бот запущен."))
                th = Thread(target=mobs.start, args=([self.Box_Mobs.currentText()]), daemon=True)
                th.start()
        else: mobs.error_mob()

    def button_start_res_f(self):
        _translate = QtCore.QCoreApplication.translate
        if self.Box_Res.currentText() != 'Выберите ресурс..':
            if self.Button_Start_Res.text() == 'Старт':
                self.Button_Start_Res.setText(_translate("MainWindow", "Бот запущен."))
                th = Thread(target=resourses.start, args=([self.Box_Res.currentText()]), daemon=True)
                th.start()
        else: resourses.error_res()

    def button_guide_mobs_f(self):
        mobs.guide()

